defs.script:
var a3_idx;
var a3_on;
var a3_fr;
var a3_playsRight,a3_isPaused;
var a3_int;
var a3_pause,a3_playRight,a3_playLeft,a3_playBwd,a3_playFwd;
var a3_fps,a3_spd;
var a3_setFps;
var a3_seekFrame,a3_gotoNext,a3_gotoPrev;
var a3_stopFirst,a3_stopLast;
(function(){
function onload(){
if(!a3_fr){
a3_fr=new Array();
a3_on=0;
var ocg=document.getElementsByClassName('ocg');
for(var i=0;i<ocg.length;i++){
var ocgName=ocg[i].getAttribute('id').split('.');
if(ocgName[0]==3){
a3_fr[ocgName[1]]=ocg[i];
}
}
a3_playsRight=true;
a3_isPaused=false;
a3_playing=false;
a3_fps=28;
a3_spd=1;
a3_setFps=function(f){
a3_fps=(f==0?1e-6:f);
if(a3_playing){
if(a3_playsRight){a3_playRight();}else{a3_playLeft();}
}
};
a3_seekFrame=function(f){
if(f>59||f<0){return -1;}
a3_idx=f;
a3_fr[a3_on].setAttribute('visibility','hidden');
a3_fr[f].setAttribute('visibility','visible');
a3_on=f;
return 0;
};
a3_stopFirst=function(){a3_pause(true);a3_seekFrame(0);};
a3_stopLast=function(){a3_pause(true);a3_seekFrame(59);};
a3_gotoNext=function(){
if(a3_seekFrame(a3_idx+1)<0){
a3_stopLast();
return;
}
};
a3_gotoPrev=function(){
if(a3_seekFrame(a3_idx-1)<0){
a3_stopFirst();
return;
}
};
a3_pause=function(stop){
try{clearInterval(a3_int);}catch(e){}
a3_playing=false;
a3_isPaused=!stop;
};
a3_playRight=function(){
var tmp_int;
try{tmp_int=setInterval('a3_gotoNext()',1000/a3_fps/a3_spd);}catch(e){}
try{clearInterval(a3_int);}catch(e){}
a3_int=tmp_int;
a3_playsRight=true;
a3_playing=true;
a3_isPaused=false;
};
a3_playLeft=function(){
var tmp_int;
try{tmp_int=setInterval('a3_gotoPrev()',1000/a3_fps/a3_spd);}catch(e){}
try{clearInterval(a3_int);}catch(e){}
a3_int=tmp_int;
a3_playsRight=false;
a3_playing=true;
a3_isPaused=false;
};
a3_stepBwd=function(){if(!a3_playing){a3_seekFrame(a3_idx-1);a3_isPaused=true;}};
a3_stepFwd=function(){if(!a3_playing){a3_seekFrame(a3_idx+1);a3_isPaused=true;}};
a3_playBwd=function(){if(a3_idx==0||!a3_isPaused){a3_stopLast();}a3_playLeft();};
a3_playFwd=function(){if(a3_idx==59||!a3_isPaused){a3_stopFirst();}a3_playRight();};
a3_seekFrame(0);
}document.getElementById('anm3').addEventListener('mouseup',onMouseUpWdgt);
document.getElementById('anm3').addEventListener('mousedown',onMouseDownWdgt);
document.getElementById('anm3').addEventListener('touchend',onTouchEndWdgt);
document.getElementById('anm3').addEventListener('touchstart',onTouchStartWdgt);
document.getElementById('anm3').addEventListener('touchmove',onTouchMove);
onvisible();
}
function onvisible(){
}
function onhidden(){
if(a3_playing){a3_pause(true);}
if(!a3_isPaused)a3_playsRight=true;
if(!a3_isPaused&&a3_idx!=0)a3_seekFrame(0);
}
function onVisibilityChange(){
if(document.hidden){try{onhidden();}catch(e){}}else{try{onvisible();}catch(e){}}
}
document.addEventListener('visibilitychange',onVisibilityChange);
window.addEventListener('load',onload);
var permPause3=false; function onWidgetUpAction(event){
try{
if(!a3_isPaused)a3_stopFirst();
if(event.shiftKey)a3_playsRight=!a3_playsRight;
if(a3_idx==59&&a3_playsRight)a3_stopFirst();
if(a3_idx==0&&!a3_playsRight)a3_stopLast();
if(a3_playsRight){a3_playRight();}else{a3_playLeft();}
}catch(e){}
}
function onTouchStartWdgt(event){
event.preventDefault();
event.stopPropagation();
permPause3=false; try{if(a3_playing){a3_pause();}}catch(e){}
}
function onTouchEndWdgt(event){
event.preventDefault();
event.stopPropagation();
if(event.targetTouches.length>0){permPause3=true;}
else{
if(permPause3){permPause3=false;}
else{onWidgetUpAction(event);}
}
}
function onTouchMove(event){
event.preventDefault();
event.stopPropagation();
}
function onMouseDownWdgt(event){
event.preventDefault();
event.stopPropagation();
try{if(a3_playing){a3_pause();}}catch(e){}
}
function onMouseUpWdgt(event){
event.preventDefault();
event.stopPropagation();
onWidgetUpAction(event);
}
})();
